use std::sync::Arc;
use tokio::{ sync::{mpsc::channel, Mutex}, task::JoinSet,
}; const WORKERS: usize = 3; // parameters needed by a task
struct JobParam { val: usize,
} // do workers' jobs
async fn process(id: usize, v: JobParam) { let sleep_secs = tokio::time::Duration::from_secs(id as u64 + 1); println!( "worker {}, processing #{}, estimated time: {}s", id, v.val, sleep_secs.as_secs() ); tokio::time::sleep(sleep_secs).await; println!("worker {}, finished processing #{}", id, v.val);
} #[tokio::main]
async fn main() { let mut tasks = JoinSet::new(); let (tx, rx) = channel(WORKERS); let rx = Arc::new(Mutex::new(rx)); for i in 0..WORKERS { let rx = rx.clone(); tasks.spawn(async move { loop { // receive a value from the channel let v = { let mut guard = rx.lock().await; guard.recv().await // mutex guard are dropped here }; if let Some(v) = v { process(i, v).await; } else { // no more values to receive break; } } }); } // note: we shoudn't just .expect or .unwrap in production code // for simplicity, we just panic here if any error occurs // dispatch jobs to workers for i in 0..10 { tx.send(JobParam { val: i }) .await .expect("send params to workers failed."); } // drop the sender to close the channel // or the workers will be blocked forever drop(tx); // wait all tasks to finish while let Some(res) = tasks.join_next().await { res.expect("worker failed."); }
}

